  const dailyStops = [
    { label: 'Lands End', coordinates: [-5.714928, 50.066276] },
    { label: 'Bodmin', coordinates: [-4.690135, 50.5568] },
    { label: 'Coleford', coordinates: [-3.364768, 50.940276] },
    { label: 'Bristol', coordinates: [-2.749924, 51.432586] },
    { label: 'Ludlow', coordinates: [-2.711933, 52.061906] },
    { label: 'St Helens', coordinates: [-2.697682, 53.046035] },
    { label: 'Kendal', coordinates: [-2.656168, 53.707341] },
    { label: 'Lockerbie', coordinates: [-2.782022, 54.365092] },
    { label: 'South Queensferry', coordinates: [-3.355403, 55.121814] },
    { label: 'Pitlochry', coordinates: [-3.446973, 56.168359] },
    { label: 'Inverness', coordinates: [-4.064444, 57.077482] },
    { label: 'Altnaharra', coordinates: [-4.357548, 57.876165] },
    { label: 'John O’Groats', coordinates: [-3.068968, 58.637301] },
  ];
  map.on('load', () => {
    map.addSource('route', {
      'type': 'geojson',
      'data': {
        'type': 'Feature',
        'geometry': {
          'type': 'LineString',
          'coordinates': coordinates
        }
      }
    });
    map.addLayer({
      'id': 'route-line',
      'type': 'line',
      'source': 'route',
      'layout': { 'line-join': 'round', 'line-cap': 'round' },
      'paint': { 'line-color': '#ff6600', 'line-width': 4 }
    });
    let i = 0;
    const marker = new mapboxgl.Marker({ color: 'red' }).setLngLat(coordinates[0]).addTo(map);
    const placedStops = new Set();
    function fly() {
      if (i < coordinates.length) {
        const point = coordinates[i];
        marker.setLngLat(point);
        const stop = dailyStops.find(s => s.coordinates[0] === point[0] && s.coordinates[1] === point[1]);
        if (stop && !placedStops.has(stop.label)) {
          new mapboxgl.Marker({ color: 'blue' })
            .setLngLat(stop.coordinates)
            .setPopup(new mapboxgl.Popup().setText(stop.label))
            .addTo(map);
          placedStops.add(stop.label);
        }
        map.flyTo({ center: point, zoom: 10, speed: 1.2, curve: 1.4, essential: true });
        i++;
        setTimeout(fly, 500);
      }
    }
    setTimeout(fly, 1500);
  });
